import React, { useState, useEffect } from 'react';
import axios from 'axios';
import './apiData.css';
import 'bootstrap/dist/css/bootstrap.min.css';

const GetData = () => {
  const [apiData, setApiData] = useState();
  const api = 'https://front-end-test-bvhzjr6b6a-uc.a.run.app';

  useEffect(() => {
    axios.get(api)
      .then(res => {

        // console.log(res.data);

        setApiData(res.data.map((element, i) => {

          const renameKeys = (obj, newKeys) => {
            console.log('tuk');
            console.log(obj);
            console.log(newKeys);
            const keyValues = Object.keys(obj).map(key => {
              const newKey = newKeys[key] || key;
              return { [newKey]: obj[key] };
            });
            return Object.assign({}, ...keyValues);
          }

          const renamedObj = renameKeys(element, 'tampons');
          console.log(renamedObj);

          // console.log(element);

          // if (typeof element.tampons === 'string') {
          //   let parser = new DOMParser();
          //   let xmlDoc = parser.parseFromString(element.tampons, "text/xml");
          //
          //   // element.tampons = xmlDoc;
          //   // console.log(xmlDoc);
          // }

          return (
            <div className="product-wrapper col-4" key={i}>
              <img className="product-img" alt="missing img" src={element.productImage} />
              <p>
                {element.currency}
              </p>
              <p>{element.price}</p>

              <div>

              </div>
            </div>
          );
        }));

      })
  },[]);

  return (
   <div className="container">
    <div className="row">
      {apiData}
    </div>
   </div>
  )
};

export default GetData;
